import Header from "./components/Navbar/NavBar";  
import Footer from "./components/Footer/Footer";  


function App() {
  return (

    <div className="App">
      <Header/>
      <main className="contenedorTienda">
        Contenido de la tienda
      </main>
      <Footer greeting={"Hola mundo"} greeting2={"Hola mundo 2"} greeting3={"Hola mundo 3"}/>
    </div>

  )
}

export default App;
